```json
{
  "application": "GROMACS",
  "details": {
    "software": "GROMACS 2020.5",
    "resources": {
      "partition": "tcb",
      "nodes": 1,
      "processes_per_node": 8,
      "wall_time": "23:30:00",
      "gpus": {
        "per_node": 2,
        "type": "gpu04"
      },
      "output_files": {
        "stdout": "job-%j.out",
        "stderr": "job-%j.err"
      },
      "email_notifications": {
        "recipient": "sergio.perez.conesa@scilifelab.se",
        "type": "FAIL"
      }
    }
  }
}
```

This script runs a GROMACS simulation. It utilizes the `tcb` partition on a cluster, requesting one node with eight MPI processes per node. The script also requires two GPUs per node (of type `gpu04`). It runs for a maximum of 23 hours and 30 minutes. The script utilizes the GROMACS 2020.5 module. It saves output to files named `job-%j.out` and `job-%j.err`. It emails the user when the job fails. The script iteratively runs `gmx mdrun` on a series of input files, restarting from a checkpoint file if it exists.
